import React from 'react';

const CardItemContent = () => (
  <ul>
    <li>Name : Shoes Puma</li>
    <li>
      Rating:
      <span role="img" aria-label="Stars">⭐️⭐️⭐️⭐️⭐️</span>
    </li>
    <li>By: CodersX</li>
    <li>Price : 16$</li>
  </ul>
);

export default CardItemContent;
